import React from "react";
import web from "../src/images/homepage1.jpg";
import {NavLink} from "react-router-dom";
import Common from "./Commonommon";


const Home = () => {
  return (
    <>
      <Common
      name="Grow your Business with " 
      imgsrc={web} 
      visit="/service" 
      btname="Get Started" 
      />
    </>
  );
};

export default Home;
